import React, { Component } from 'react';
import logo from '../assets/images/LOGOPRO.png';
import { NavLink } from 'react-router-dom';


class Header extends Component {
    render() {
        return (
            <header id="header">
                <div className="center">
                    {/*<!--LOGO-->*/}
                    <div id="logo">
                        <img src={logo} href="/" className="app-logo" alt="logotipo" />
                        <span id="brand">
                            <strong>Restaurant </strong>Siglo XXI
                        </span>
                    </div>

                    {/*<!--MENU-->*/}
                    <nav id="menu">
                        <ul>
                            <li>
                                <NavLink to="/home" activeClassName="active" >Bienvenido</NavLink>
                            </li>
                            <li>
                                <NavLink to="/blog" activeClassName="active" >Comida</NavLink>
                            </li>
                            <li>
                                <NavLink to="/peliculas" activeClassName="active" >Bajativos</NavLink>
                            </li>
                            <li>
                                <NavLink to="/formulario" activeClassName="active" >Contactanos</NavLink>
                            </li>

                        </ul>

                    </nav>

                    {/*<!--LIMPIAR LOS FLOATS-->*/}
                    <div className="clearfix"></div>

                </div>
            </header>
        );
    }
}

export default Header;
